fecha = datetime.today().strftime('%Y-%m-%d')
fecha_file = datetime.today().strftime('%Y%m%d')
fecha_folder = datetime.today().strftime('%Y%m')

df = pd.DataFrame(columns = ['fecha','nombre_producto','precio'])

for url in urls:
    try:
        html_content = requests.get(url).text

        soup = BeautifulSoup(html_content, "html.parser")
        price_html = soup.find_all('span', class_="atg_store_productPrice")
        name_html = soup.find('h1', {'class': 'product_page'})

        product_price = float(str(price_html).split('$')[1].split('\n')[0].replace(',','.'))
        product_name = name_html.text.replace('\n','').replace('\t','').replace('\r','')

        to_append = [fecha, product_name, product_price]
        row = pd.Series(to_append, index = df.columns)
        df = df.append(row, ignore_index = True)

    except:
        pass

spark.createDataFrame(df).write.mode('append').insertInto('tabla_precios_coto')